import './App.css';
import React, { useEffect } from "react";
import Home from './Home.js';
import Header from './Header.js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/">
            <Header></Header>
            <Home></Home>
          </Route>
          <Route exact path="/a">
            <Header></Header>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
